import Gallery from "../components/Gallery"
import fs from "fs"

fs.readFile('/etc/hosts', 'utf8', function (err,data) {
  if (err) {
    return console.log(err);
  }
  console.log(data);
});

export default function Inspo() {
  return (
    <Gallery galleryDirectory="../gallery/inspo"/>
  )
}
